   CHECK(to_f32(*bkend.call_with_return(nullptr, "env",  "add", (float)-0x1p-126, (float)-0x1p+0)) == (float)-0x1p+0);
   CHECK(to_f32(*bkend.call_with_return(nullptr, "env",  "add", (float)-0x1p-126, (float)0x1p+0)) == (float)0x1p+0);
   CHECK(to_f32(*bkend.call_with_return(nullptr, "env",  "add", (float)0x1p-126, (float)-0x1p+0)) == (float)-0x1p+0);
   CHECK(to_f32(*bkend.call_with_return(nullptr, "env",  "add", (float)0x1p-126, (float)0x1p+0)) == (float)0x1p+0);
